import React from "react";
import { useDispatch, useSelector } from "react-redux";
import { setLoggedIn } from "../../redux/actions/actions";
import {setUserDetatil} from "../../redux/actions/actions";
function LoadingComponent(props) {
  const isLoggedin=useSelector(state=>state.isLoggedin);
  const dispatch=useDispatch();
  const data={
		"userId": "1245454",
		"userName": "alpha",
		"userAge": "22",
		"userTitle": "Full Stack Developer | Android Developer",
		"userCourseDetails": {
			"course": "B.tech",
			"branch": "CSE",
			"year": "3"
		},
		"userProfilePicture": "https://image.freepik.com/free-vector/sunset-mountains-with-pine-forest_7993-2327.jpg"
	}
  return (
    <div className="Loading">
      <div className="Loading_inner">
        <h1 >{props.text} {isLoggedin.toString()}</h1>
        <button onClick={()=>{dispatch(setLoggedIn()); dispatch(setUserDetatil(data))} }>asf</button>
        {dispatch(setUserDetatil(data))}
      </div>
    </div>
  )
}
export default LoadingComponent;
